import { Routes, Route } from 'react-router-dom';
import Carousel from './components/Carousel';
import './app.css';

export default function App() {
   return (
      <main className='App'>
         <section className='container px- px-md-0 py-5'>
            <Routes>
               <Route path='/' element={<Carousel />} />
            </Routes>
         </section>
      </main>
   );
}
